import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <div className='app__header'>
            <img
                className='app__header-image'
                src="https://logos-world.net/wp-content/uploads/2020/04/Instagram-Logo.png"
                alt="logo"/>
        </div>
    </div>
  );
}

export default App;
